import './App.css';
import CarouselControll from "./components/Carousel"
import { NavbarNested } from './components/Navbar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <CarouselControll></CarouselControll>
        <NavbarNested></NavbarNested>
      </header>
    </div>
  );
}

export default App;
